import * as React from "react";
import { AppBar, Toolbar, Typography, Box, Button, IconButton } from "@mui/material";
import ShoppingCartIcon from "@mui/icons-material/ShoppingCart";
import { Link } from "react-router-dom";

export default function NavigationBar() {
  return (
    <AppBar position="static" color="default" elevation={1}>
      <Toolbar
        sx={{
          display: "flex",
          justifyContent: "space-between",
          alignItems: "center",
        }}
      >
        {/* Logo Placeholder with Link */}
        <Typography
          variant="h6"
          component={Link}
          to="/new" // Link to the main page
          sx={{
            display: "flex",
            alignItems: "center",
            fontWeight: "bold",
            textDecoration: "none", // Remove underline from the link
            color: "inherit", // Inherit text color from the theme
          }}
        >
          <Box
            sx={{
              width: 40,
              height: 40,
              backgroundColor: "#ccc",
              borderRadius: "50%",
              display: "inline-block",
              marginRight: 1,
            }}
          />
          Logo Placeholder
        </Typography>

        {/* Center Navigation */}
        <Box sx={{ display: "flex", gap: 3 }}>
          <Button component={Link} to="/venues" color="inherit">
            Venues
          </Button>
          <Button component={Link} to="/hair" color="inherit">
            Hair
          </Button>
          <Button component={Link} to="/makeup" color="inherit">
            Makeup
          </Button>
          <Button component={Link} to="/photographers" color="inherit">
            Photographers
          </Button>
          <Button component={Link} to="/music" color="inherit">
            Music
          </Button>
        </Box>

        {/* Shopping Cart */}
        <IconButton component={Link} to="/cart" color="inherit">
          <ShoppingCartIcon />
        </IconButton>
      </Toolbar>
    </AppBar>
  );
}
